<h5 class="page_title" data-speed="0.6" data-lag="0.2">Disclosures</h5>


<div class="main_text">

<p>Investment opportunities posted on this website are "private placements" of GET Holdings and are not publicly traded, yet are subject to holding period requirements which are intended for investors who do not need a liquid investment. Investing in private companies may be considered highly speculative and involves a high degree of risk, including the risk of substantial loss of investment. Investors must be able to afford the loss of their entire investment. See our Risk Factors for a more detailed explanation of the risks involved in investing in GET Resources Holdings.
<br><br>
ThisisGET.com is intended only for accredited investors (for persons residing in the U.S.), and for persons residing abroad in jurisdictions where securities registration exemptions apply. No communication through this website or in any other medium should be construed as an investment recommendation.
<br><br>
Private placement investments are NOT bank deposits (and thus NOT insured by the FDIC or by any other federal governmental agency), are NOT guaranteed by GET or its affiliates, and MAY lose value.
