Any financial projections or returns shown on the website are illustrative examples only, and there can be no assurance that any valuations provided are accurate or in agreement with market or industry valuations.
<br><br>
Any investment information contained herein has been secured from sources GET believes are reliable, but neither GET nor its affiliates make any representations or warranties as to the accuracy of such information and accept no liability therefore.
<br><br>
Offers to sell, or the solicitations of offers to buy, any security can only be made through official offering documents that contain important information about risks, fees and expenses. For additional details regarding the allocation policies of GET and affiliated entities, please review our Allocation Policy.
<br><br>
Investors should conduct their own due diligence, not rely on the financial assumptions or estimates displayed on this website, and are encouraged to consult with a financial advisor, attorney, accountant, and any other professional that can help you to understand and assess the risks associated with any investment opportunity.
<br><br>
<span class="section_title">RISK FACTORS</span>
<br><br>
An investment through GET’s platform will involve risks not associated with other investment alternatives. Prospective investors should carefully consider, among other factors, the risks described herein. These risk factors are not meant to be an exhaustive listing of all potential risks associated with an investment in GET or its affiliates. There can be no assurance that the investment objectives will be achieved, or that there will be any return of capital. An investment in GET or its affiliates is a potentially suitable investment only for sophisticated investors who are capable of assuming the risks of such an investment, including the potential risk of losing all of their invested capital.
These risk factors are not a complete enumeration or explanation of the risks involved in investing in GET or its affiliates. Prospective investors should consult with their own advisers prior to making any decision to invest in GET or it’s affiliates.
<br><br>
<span class="section_title">INVESTING IN TECHNOLOGY COMPANIES</span>
<br><br>
<span class="section_subtitle">General</span><br>
Investment in GET or its affiliates will be subject to numerous risks generally related to investing in securities and other investments, and the additional risks associated with investing in non-marketable securities and non-public companies or holding companies which own any of the aforementioned. The securities or other interests acquired by GET will have restrictions on resale and, even in the absence of such restrictions, may not be marketable. The ability of an ownership interest of GET or its affiliates to profit from its investments will be highly dependent upon the ability of its investments to generate income or appreciate in value. Numerous factors may impede or prevent an investment from reaching this point, including inadequate capital, unfavorable competitive developments, adverse legislation at the national, state, or local level, inadequate management or loss of key persons, technology obsolescence, and lack of market acceptance. Investments may face significant capital shortfalls for a wide variety of reasons. Resource development may prove more expensive, or take more time, than anticipated, and the growth in revenues may be slower than expected. Any of such occurrences may result in the failure of an investment and a loss with respect to GET and its affiliates’ holdings.
<br><br>
<span class="section_subtitle">No Operating History</span><br>
Any GET holding company has no previous operating history and will be entirely dependent upon GET Resources Group LLC as the Manager (the “Manager”). No person should be willing to make an investment in GET or its affiliates unless such person is willing to fully rely upon the Manager’s ability to effect investments on behalf of the holding company.
<br><br>
<span class="section_subtitle">General Investment Risks Associated with Investments</span><br>
GET and its affiliates will generally invest in shares of common or preferred stock of private issuers. Each of such investment opportunities will entail certain risks that may adversely affect the holding company’s operations and, in turn, an investment in the holding company. These risks may involve, without limitation, general economic risks and volatility associated with such investments, the illiquidity of such investments and a potential lack of recourse with respect to adverse actions by, or associated with, the issuers of shares of common or preferred stock invested in by GET. The value of GET Holdings is derived, in part, from the value of the underlying issuers associated with its investments. Equity securities of private issuers can be highly volatile and expose investors to a high risk of loss. Moreover, there is no exchange market on which to close out an open investment. Consequently, it may be impossible to liquidate an existing investment, to accurately assess the value of investment or to accurately assess the exposure to risk associated with a particular investment. No person should be willing to make an investment in GET or it’s affiliates unless such person is capable of losing such person’s entire investment.
<br><br>
<span class="section_subtitle">Preferred Stockholder Liquidation Preference</span><br>
GET Holdings invests in common or preferred stock of private companies (“Investee Companies”). An Investee Company may grant liquidation preferences to certain of its preferred stockholders. A liquidation preference provides that upon an initial public offering, liquidation, acquisition, or sale of all or substantially all of the assets of the Investee Company (a “Liquidity Event”), senior preferred stockholders will have the option to receive the amount of their liquidation preference first in full, before any proceeds are delivered to junior preferred or common stockholders. Where all classes of preferred stock elect to receive their liquidation preference in full, they may receive a disproportionate share of proceeds in a Liquidity Event, and common stockholders will generally share ratably in any remaining sales proceeds. Likewise, one or more classes of preferred stock may receive a disproportionate share of proceeds relative to junior classes of preferred stock in a Liquidity Event. Because GET or its affiliates may invest in common stock (or a class of junior preferred stock), overall returns may be negatively impacted by liquidation preferences. Specifically, if an Investee Company undertakes a Liquidity Event at a valuation that is less than the implied valuation at which GET or its affiliates purchases common or preferred stock in an Investee Company, the overall returns may be negatively impacted than if no liquidation preference were present.
<br><br>
<span class="section_subtitle">Participating Preferred Stock</span><br>
Certain preferred securities issued by an Investee Company may hold participation rights (“Participating Preferred”), which entitles holders of those securities to participate pro rata with common stockholders in addition to receiving the holders’ liquidation preference amount in a Liquidity Event. Because Participating Preferred may result in less residual value accruing to holders of other securities of the Investee Company, which may include holdings in GET or its affiliates, overall returns may be negatively impacted by any Participating Preferred.
<br><br>
<span class="section_subtitle">IPO Ratchet</span><br>
The securities issued by an Investee Company may contain an anti-dilution provision under which, if an Investee Company goes public below a predetermined price, the holders of such securities will receive a downward conversion price adjustment, resulting in the issuance of additional securities to those holders (an “IPO Ratchet”). Because GET or its affiliates may invest in shares of common or preferred stock of an Investee Company that may be diluted by an IPO Ratchet, overall returns may be negatively impacted by the presence of any IPO Ratchet.
<br><br>
<span class="section_subtitle">Cumulative Dividends</span><br>
One or more securities issued by an Investee Company may contain cumulative dividend rights, whereby holders of those securities will accumulate unpaid dividends at a predetermined rate, which accrue to the liquidation preference of those securities over time (“Cumulative Dividends”). Because Cumulative Dividends may increase the liquidation preference of securities more senior to those held by GET or its affiliates, they may negatively impact the overall returns over time.
<br><br>
<span class="section_subtitle">Lack of Transparency in Investee Company Operations</span><br>
As Investee Companies are not required to make periodic public filings, certain operational information about the Investee Companies are not available to GET or its affiliates prior to investment, including historical financial results and projected financial results, customer and sales data, strategic plans, and management discussion of operations. As a result, the investments of GET or its affiliates are made on the basis of publicly available information, which may be incomplete, inaccurate, or not confirmed by the Investee Company.
<br><br>
<span class="section_subtitle">Investee Companies’ Operations and Financial Results Subject to Various Risks</span><br>
Revenues and operating results of Investee Companies could vary significantly from quarter to quarter and year to year because of a variety of factors, many of which are outside of the control of the Investee Companies and the holdings of GET or its affiliates. As a result, operational results of an Investee Company known prior to an investment by GET or its affiliates may vary significantly following an investment. This may result in a decline in the value of an investment in GET or its affiliates, including a complete loss of such investment. Factors that may contribute to the variability of an Investee Company’s operational and financial results include and are not limited to:

    <ul>
     <li> the ability of an Investee Company to maintain an adequate rate of growth;</li>
     <li> the ability of an Investee Company to attract new customers;</li>
     <li> the ability of an Investee Company to retain existing customers;</li>
     <li> the effects of increased competition in the Investee Company’s business and the ability of the Investee Company to compete with competitors that may have longer operating histories and greater financial and operational resources;</li>
     <li> the ability of an Investee Company to keep pace with changes in technology and its competitors;</li>
     <li> the ability of an Investee Company to protect its and its customers’ data, technology or other intellectual property from third-party infringement or from misappropriation in the U.S. and abroad;</li>
     <li> the ability of an Investee Company to defend itself against potential and actual intellectual property litigation alleging such Investee Company of infringement of a third-party's intellectual property;</li>
     <li> declines or disruptions in the industries and markets in which an Investee Company operates;</li>
     <li> the ability of an Investee Company to successfully enter new markets and manage expansion, including expansion in international markets;</li>
     <li> the ability of an Investee Company to provide a high-quality customer experience through its products and services;</li>
     <li> the ability of an Investee Company to successfully manage any acquisitions of businesses, solutions, or technologies;</li>
     <li> the success of an Investee Company’s marketing efforts; and</li>
     <li> the ability of an Investee Company to comply with applicable federal and state laws, rules, or regulations as well as any rules of applicable networks and associations.</li>
    </ul>

     <br><br>
<span class="section_subtitle">No Assurance of Investment Return</span><br>
The task of identifying investment opportunities on behalf of GET or its affiliates and managing such investments is difficult. Many organizations operated by persons of competence and integrity have been unable to make similar investments successfully. There is no assurance that GET or its affiliates’ objectives will be attained, or that the value of the investments will not decline, or that there will be any return of capital.
<br><br>
<span class="section_subtitle">Diversification</span><br>
GET or its affiliates’ investments are expected to be concentrated in a relatively small number of investments and will not be widely diversified. Any investment, directly or indirectly, in GET or its affiliates should not be considered a complete investment program. Such concentration of risk may expose GET or its affiliates to losses disproportionate to those incurred by any particular market in general. In the event of a detrimental effect with respect to one or more of the underlying issuers comprising GET or its affiliates investments, such investment vehicle’s overall returns may be impacted much more negatively than they would be if its investments were spread more broadly.
<br><br>
<span class="section_subtitle">Market Factors</span><br>
General fluctuations in the economy may affect the value of investments held by GET or its affiliates. In such event, the ability to achieve a favorable return on its investments may be severely impeded.
<br><br>
<span class="section_subtitle">Long-Term Investment</span><br>
Given the investment objectives of GET or its affiliates, its investments, by their nature, may be long-term investments. An investment in GET or its affiliates is therefore only appropriate for investors with a long-term investment horizon and a capacity to absorb a loss of some or all of their investment.
<br><br>
<span class="section_subtitle">Other Activities of the Manager</span><br>
The success of GET or its affiliates will be largely dependent upon the efforts of the Manager. Although an investment management will be one of the business activities of the Manager, the Manager will devote such time and efforts to the business of GET or its affiliates as it believes are reasonably required to carry out the business of such entities. The Manager and its employees, and other affiliates may engage in other business activities, and the business of GET or its affiliates may not be such persons’ primary business activity.
<br><br>
<span class="section_subtitle">Conflicts of Interest</span><br>
The Manger serves as manager to both GET (“Solo Name Funds”) that generally invest in shares of common or preferred stock of private issuers and to discretionary managed funds (“Discretionary Funds”), which make investments in portfolios of private securities offerings, and which may include one or more Solo Name Vehicles. As a result, there may be a conflict of interest between the Manager’s role for the Solo Name Funds and its role for the Discretionary Funds. The manager follows a written allocation policy to ensure the fair and equitable allocation of investment opportunities, which the Manager believes avoids and/or mitigates potential conflicts of interest. Additional information concerning these allocation policies can be found at https://thisisget.com/legal_pages/allocation.
<br><br>
<span class="section_subtitle">Investments by Employees and Affiliates</span><br>
Eligible employees and other affiliates of GET are permitted to invest in both Solo Name Funds and Discretionary Funds (each an “Affiliated Investment”), which may present a conflict of interest between the Manager and the investors in the Solo Name Funds or Discretionary Funds. Affiliated Investments in the Discretionary Funds are subject to lower minimum investments and fee waivers. Each Affiliated Investment is accepted in the same sequence and priority as other potential Members’ investments. Notwithstanding the foregoing, the Manager believes that the opportunities offered to prospective Members are fair to the Solo Name Funds, the Discretionary Funds and their respective investors.
<br><br>
<span class="section_subtitle">No Right to Control Company Operations</span><br>
The investors in GET or its affiliates will have no opportunity to control the day-to-day operations, including investment and disposition decisions. The investors must rely entirely on the Manager to conduct and manage the affairs of GET or its affiliates.
<br><br>
<span class="section_subtitle">Illiquidity of the Interests; Limited Transferability of the Interests</span><br>
The membership interests in GET or its affiliates are highly illiquid, have no public market, and generally are not transferable, except with the consent of the Manager and compliance with applicable securities laws. Voluntary withdrawals of the interests are generally not permitted.
<br><br>
<span class="section_subtitle">Cross-Series Liability</span><br>
The Manager expects that pursuant to Section 18-215 of the Delaware Act, the debts, liabilities, obligations, and expenses of each GET investment shall be enforceable against the assets of each respective GET investment only, and not against GET or its affiliates generally or against any other GET investment. However, notwithstanding that series limited liability companies have been authorized by the Delaware Act, the robustness of their asset and liability segregation has not been extensively tested by the courts. There can be no guarantee that each GET investment will be treated as a separate and distinct legal entity for purposes of the Delaware Act, ERISA, bankruptcy laws, or otherwise.
<br><br>
<span class="section_subtitle">Indemnification of Certain Persons</span><br>
The Limited Liability Company Operating Agreement governing a GET investment will contain broad indemnification and exculpation provisions that limit the right of a member of any GET investment to maintain an action against the relevant GET investment, the Manager, GET, and/or their affiliates to recover losses or costs incurred by a GET investment as a result of such persons’ actions or failures to act.
<br><br>
<span class="section_subtitle">Disposition of Investments</span><br>
Part or all of one or more investments made by GET or its affiliates may not be completely disposed of prior its dissolution and liquidation, in the event of which a GET investment may make in-kind liquidation distributions to its members of securities in the Holdings that have not been disposed of.
<br><br>
<span class="section_subtitle">Possible Adverse Tax Consequences</span><br>
Any GET investment will be classified as a partnership for federal income tax purposes, and not as an association taxable as a corporation. No representation or warranty of any kind is made with respect to the tax consequences of an investment in GET or its affiliates, or the allocation of taxable income or loss, as provided in the applicable Operating Agreement. Potential investors are advised to consult their own tax advisors with respect to the tax consequences to them of an investment in GET or its affiliates.
<br><br>
<span class="section_subtitle">Absence of Regulatory Oversight</span><br>
GET or its affiliates is/are not registered as an investment company under the U.S. Investment Company Act of 1940, as amended, in reliance upon an exemption available to privately offered investment companies and, accordingly, the provisions of such Act (which, among other things, require investment companies to have a majority of disinterested directors, provide limitations on leverage, limit transactions between investment companies and their affiliates and regulate the relationship between the adviser and the investment company) are not applicable to GET or its affiliates. Membership interests in GET or its affiliates have not been registered under the Securities Act or the securities laws of any state in the U.S., nor is it expected that they will be. The Manager has no plans nor has it assumed any obligations to register membership interests of any of GET or its affiliates. The Manager is an exempt reporting adviser and is not registered as an investment adviser with the Securities and Exchange Commission under the Investment Advisers Act. Such status does not imply that the Securities and Exchange Commission has endorsed or approved the qualifications of the Manager or any of its respective affiliates or representatives to provide the advisory services described herein.
<br><br>
<span class="section_subtitle">Future Regulatory and Legal Developments</span><br>
This document cannot address or anticipate every possible current or future regulation or legal development (including change in law) that may affect the Manager, any GET or its affiliates investment, or their respective businesses and operations. Such regulations may have a significant impact on the Manager and the investment, including but not limited to, restricting the types of investments GET or its affiliates may make, or requiring the Manager to disclose certain confidential information regarding its terms, investments, or investors. The Manager, in its sole discretion, may cause GET or its affiliates to be subject to certain regulations if it believes that an investment or business activity is in such company/companies interest, as the case may be, even if such regulations may have a detrimental effect on one or more investors. Prospective investors are encouraged to consult their own advisers regarding an investment in GET or its affiliates.
<br><br>
<span class="section_subtitle">Cybersecurity Risk</span><br>
Malware, viruses, hacking, and phishing attacks have become more prevalent in recent years, and may occur on GET or its affiliates systems in the future. Although it is difficult to determine what, if any, harm may directly result from an attack, any failure to maintain the security of GET or its affiliates systems may result in unauthorized requests to access bank and investment accounts, the disclosure of information that GET and its affiliates are obligated to keep confidential, or other improper or illegal activities that could result in a financial loss to GET or its affiliates, investment or investors in GET or its affiliates’ holdings.
<br><br>
<span class="section_subtitle">Business Continuity and Disaster Recovery</span><br>
The Manager, its affiliates and GETs’ business operations may be vulnerable to disruption in the case of catastrophic events such as fires, natural disaster (e.g., tornadoes, floods, hurricanes and earthquakes), terrorist attacks, pandemic(s), or other circumstances resulting in property damage, network interruption and/or prolonged power outages. There can be no assurances that all contingencies can be planned for. These risks of loss can be substantial and could have a material adverse effect on GET and or its affiliates, and the members’ investments therein.
<br><br>
<span class="section_subtitle">Systems and Operational Risks</span><br>
Each GET investment depends on the Manager to develop and implement appropriate systems for its activities. Each GET investment relies on financial, accounting and other data processing systems to execute, clear and settle transactions and to evaluate certain securities, to monitor its portfolio and capital, and to generate risk management and other reports that are critical to oversight of its activities. In addition, each GET investment relies on information systems to store sensitive information about the holding(s), GET, the Manager, their affiliates and investors in GET or its affiliates. Certain of GET and the Manager’s activities will be dependent upon systems operated by third parties, including the administrator, market counterparties and other service providers, and the Manager may not be in a position to adequately verify the risks or reliability of such third-party systems. Failures in the systems employed by the Manager, the Administrator, counterparties, exchanges and similar clearance and settlement facilities and other parties could result in mistakes made in the confirmation or settlement of transactions, or in transactions not being properly booked, evaluated or accounted for. Disruptions in GET or its affiliates’ operations or breach of information systems may cause GET or its affiliates to suffer, among other things, financial loss, the disruption of its business, liability to third parties, regulatory penalties or reputational damage. Any of the foregoing failures or disruptions could have a material adverse effect on GET, the GET holdings, and the respective investments.
<br><br>
<span class="section_subtitle">Lack of Transparency in Investee Company Operations</span><br>
GET or its affiliates invests in common or preferred stock in private companies (“Investee Companies”). As Investee Companies are not required to make periodic public filings, certain operational information about the Investee Companies are not available to the investment vehicle prior to investment, including historical financial results and projected financial results, customer and sales data, strategic plans, and management discussion of operations. As a result, such investment vehicle’s investments are made on the basis of publicly available information, which may be incomplete, inaccurate, or not confirmed by the Investee Company.
<br><br>
<span class="section_subtitle">Post-IPO Transfer Restrictions May Limit Your Ability to Sell Shares on the Open Market</span><br>
When a company goes public, there are some procedural steps and legal requirements that must be followed. Generally, we will seek to unwind the GET investment into which you invested (the "Holdings") and transfer a number of shares, equivalent to your pro rata ownership in the Holdings, to a brokerage account you designate.
The shares held by the Holdings are generally subject to two principal types of transfer restrictions. They are subject to a standard IPO lock-up, which means that for a period of 180 days after the IPO, the shares cannot be transferred. The shares held by the Holdings are also considered Restricted Securities under the securities laws. Generally, this means, even post-IPO, the shares can't be sold on the open market until they've been held for 1 year. Together with the lock-up, shares held by the Holdings can't be sold on the open market until the later of (i) expiry of the lock-up or (ii) one year following purchase.
Generally, the company will use a transfer agent, who will hold custody of the pre-IPO shares. After the completion of the IPO, the shares purchased in the Holdings will be held with the transfer agent. Once applicable transfer restrictions are satisfied, we will request the transfer agent to remove restrictive legends from the shares and transfer a number of shares, equivalent to your pro rata ownership in the Holdings, to a brokerage account of your designation.
<br><br>
<span class="section_subtitle">Investee Companies’ Operations and Financial Results Subject to Various Risks</span><br>
Revenues and operating results of Investee Companies could vary significantly from quarter to quarter and year to year because of a variety of factors, many of which are outside of the control of the Investee Companies and GET. As a result, operational results of an Investee Company known prior to an investment by GET or its affiliates may vary significantly following an investment. This may result in a decline in the value of an investment in the investment vehicle, including a complete loss of such investment. Factors that may contribute to the variability of an Investee Company’s operational and financial results include but are not limited to: the ability of an Investee Company to maintain an adequate rate of growth; the ability of an Investee Company to attract new customers; the ability of an Investee Company to retain existing customers; the effects of increased competition in the Investee Company’s business and the ability of the Investee Company to compete with competitors that may have longer operating histories and greater financial and operational resources; the ability of an Investee Company to keep pace with changes in technology and its competitors; the ability of an Investee Company to protect its and its customers’ data, technology or other intellectual property from third-party infringement or from misappropriation in the U.S. and abroad; the ability of an Investee Company to defend itself against potential and actual intellectual property litigation alleging such Investee Company of infringement of a third-party's intellectual property; declines or disruptions in the industries and markets in which an Investee Company operates; the ability of an Investee Company to successfully enter new markets and manage expansion, including expansion in international markets; the ability of an Investee Company to provide a high-quality customer experience through its products and services; the ability of an Investee Company to successfully manage any acquisitions of businesses, solutions, or technologies; the success of an Investee Company’s marketing efforts; and the ability of an Investee Company to comply with applicable federal and state laws, rules, or regulations as well as any rules of applicable networks and associations.
<br><br>
<span class="section_subtitle">Disposition of Investments</span><br>
Part or all of one or more investments made by GET or its affiliates may not be completely disposed of prior to the dissolution and liquidation of such investment vehicle, in the event of which the Manager may make in-kind liquidation distributions to the investors.
<br><br>
<span class="section_subtitle">Possible Dilution of Company Assets</span><br>
On occasion, an Investee Company may need additional financing to support operations or growth. It is not certain that additional financing will be available to an Investee Company on favorable terms when required. If an Investee Company raises additional funds through the issuance of equity, equity-linked, or debt securities, those securities may have rights, preferences, or privileges senior to the rights of the common stock held by GET or its affiliates. Furthermore, an Investee Company may raise additional funds through new classes of stock which convert into common stock on more than a one-to-one basis. This would materially impact the dilutive effects of this issuance on the investors.
<br><br>
<span class="section_subtitle">Operation and Investment of Parallel Series</span><br>
As part of a single transaction, one or more GET investments may invest, or seek to invest, in the same Investee Company. In this instance, in accepting investors into GET or its affiliates, the Manager may separate investors who meet the requirements of an “accredited investor” from investors who meet the requirements of a “qualified purchaser” into separate parallel series. For such a transaction, it is expected that both series will generally operate in parallel with each other and are expected to invest in the Investee Company on substantially the same terms and conditions, legal, tax regulatory, accounting, contractual, business and other similar considerations applicable to a particular series of a GET investment. It is possible however, that an Investee Company may limit, restrict or eliminate the amount or type of investments that can be made by GET or its affiliates or, in the event established by the Manager, its parallel series for such a transaction. Accordingly, the performance of any GET investment or, in the event established by the Manager, its parallel series, may differ materially from each other due to differences in the respective portfolio construction of its investments.
